Actions["aqwaqa"] = {direction = "EAST", name = "Separation Distillation", is_per_world = "False", id = "moreiotas:string/split", action = function(self, castEnv)
    local seperator = castEnv.stack:pop().string
    local input = castEnv.stack:pop().string
    local output = Hexcasting.Iotas.hexcasting.list:new()
    output:append(Hexcasting.Iotas.moreiotas.string:new(""))
    
    for i = 1, #input do
        local char = input:sub(i,i)
        if seperator == "" then
            output:append(Hexcasting.Iotas.moreiotas.string:new(char))
        elseif char == seperator then
            output:append(Hexcasting.Iotas.moreiotas.string:new(""))
        else
            output.list[output:length()].string = output.list[output:length()].string .. char
        end
    end

    if seperator == "" then
        output:append(Hexcasting.Iotas.moreiotas.string:new(""))
    end
    
    castEnv.stack:push(output)
end}
